      <h6 style={{marginTop:'20px',marginRight :'50px',fontWeight : 'bold'}} ><UserOutlined style={{verticalAlign: 'top'}}/> 이주혁님 </h6>
      </div>

    </nav>
  )
}

export default NavBar
